INSERT INTO `movies` (`slug`, `title`, `description`, `duration`, `released`, `genre`, `country`, `thumbnail`, `url`, `rating`) VALUES
('alien-romulus', 'Alien: Romulus', 'While scavenging the deep ends of a derelict space station, a group of young space colonizers come face to face with the most terrifying life form in the universe.', 7140, '2024-08-16', 'Science Fiction', 'VN', 'https://www.themoviedb.org/t/p/w1280/b33nnKl1GSFbao4l3fZDDqsMx0F.jpg', 'https://youtube.com/embed/x0XDEhP4MQs', 3.7),
('apocalypse-z-the-beginning-of-the-end', 'Apocalypse Z: The Beginning of the End', 'When a kind of rabies that transforms people into aggressive creatures spreads across the planet, Manel isolates himself at home with his cat, relying on his wits to survive; but soon they must go out in search of food, by land and by sea, dodging many dangers.', 7140, '2024-10-04', 'Drama', 'ES', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/wIGJnIFQlESkC2rLpfA8EDHqk4g.jpg', 'https://youtube.com/embed/zeQXjn3JJ-A', 3.4),
('arcadian', 'Arcadian', 'In the near future, on a decimated Earth, Paul and his twin sons face terror at night when ferocious creatures awaken. When Paul is nearly killed, the boys come up with a plan for survival, using everything their father taught them to keep him alive.', 5520, '2024-04-12', 'Science Fiction', 'US', 'https://www.themoviedb.org/t/p/w1280/spWV1eRzlDxvai8LbxwAWR0Vst4.jpg', 'https://youtube.com/embed/HNARuSROxbM', 3.0),
('classified', 'Classified', 'Operating alone in the field for more than 20 years, a CIA hitman uses the \"Help Wanted\" section of the newspapers to get his orders from the Agency. His long-lost daughter, now a UK MI6 analyst, tracks him down to deliver shocking news: his CIA boss has been dead for years and the division long since shut down. Together, they set out to discover whose orders he\'s been executing.', 6300, '2024-10-22', 'Thriller', 'US', 'https://www.themoviedb.org/t/p/w1280/3k8jv1kSAAc0rCfFGtWDDQL4dfK.jpg', 'https://youtube.com/embed/klTtuOaNdG4', 2.8),
('deadpool-wolverine', 'Deadpool & Wolverine', 'A listless Wade Wilson toils away in civilian life with his days as the morally flexible mercenary, Deadpool, behind him. But when his homeworld faces an existential threat, Wade must reluctantly suit-up again with an even more reluctant Wolverine.', 7680, '2024-07-26', 'Action', 'VN', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/8cdWjvZQUExUUTzyp4t6EDMubfO.jpg', 'https://youtube.com/embed/Idh8n5XuYIA', 4.0),
('despicable-me-4', 'Despicable Me 4', 'Gru and Lucy and their girls—Margo, Edith and Agnes—welcome a new member to the Gru family, Gru Jr., who is intent on tormenting his dad. Gru also faces a new nemesis in Maxime Le Mal and his femme fatale girlfriend Valentina, forcing the family to go on the run.', 5640, '2024-05-07', 'Action', 'VN', 'https://www.themoviedb.org/t/p/w1280/wWba3TaojhK7NdycRhoQpsG0FaH.jpg', 'https://youtube.com/embed/LtNYaH61dXY', 3.6),
('gladiator-ii', 'Gladiator II', 'Years after witnessing the death of the revered hero Maximus at the hands of his uncle, Lucius is forced to enter the Colosseum after his home is conquered by the tyrannical Emperors who now lead Rome with an iron fist. With rage in his heart and the future of the Empire at stake, Lucius must look to his past to find strength and honor to return the glory of Rome to its people.', 8880, '2024-11-15', 'Action', 'VN', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/2cxhvwyEwRlysAmRH4iodkvo0z5.jpg', 'https://youtube.com/embed/TQwSz88ITAE', 3.4),
('knox-goes-away', 'Knox Goes Away', 'A contract killer, after being diagnosed with a fast-moving form of dementia, is presented with the opportunity to redeem himself by saving the life of his estranged adult son. But to do so, he must race against the police closing in on him as well as the ticking clock of his own rapidly deteriorating mind.', 6840, '2024-03-15', 'Action', 'US', 'https://www.themoviedb.org/t/p/w1280/w39qKYjltCix18BwtoZ1e45usdb.jpg', 'https://youtube.com/embed/UiMNmOajf-E', 3.4),
('kraven-the-hunter', 'Kraven the Hunter', 'Kraven Kravinoff\'s complex relationship with his ruthless gangster father, Nikolai, starts him down a path of vengeance with brutal consequences, motivating him to become not only the greatest hunter in the world, but also one of its most feared.', 7620, '2024-12-13', 'Action', 'VN', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/1GvBhRxY6MELDfxFrete6BNhBB5.jpg', 'https://youtube.com/embed/hR1-ihzff3I', 0.0),
('levels', 'Levels', 'After witnessing his girlfriend\'s murder, a man risks everything - including reality itself - to discover the truth.', 5520, '2024-11-01', 'Action', 'US', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/yq39ChrCDlqrurYuaC8WM0vC1cx.jpg', 'https://youtube.com/embed/cCggBmznfTA', 2.8),
('moana-2', 'Moana 2', 'After receiving an unexpected call from her wayfinding ancestors, Moana journeys alongside Maui and a new crew to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she\'s ever faced.', 6000, '2024-11-29', 'Comedy', 'VN', 'https://www.themoviedb.org/t/p/w1280/m0SbwFNCa9epW1X60deLqTHiP7x.jpg', 'https://youtube.com/embed/JdSl4RMNtGE', 3.8),
('overlord-the-sacred-kingdom', 'OVERLORD: The Sacred Kingdom', 'After twelve years of playing his favorite MMORPG game, Momonga logs in for the last time only to find himself transported into its world playing it indefinitely. Throughout his adventures, his avatar ascends to the title of Sorcerer King Ains Ooal Gown. Once prosperous but now on the brink of ruin, The Sacred Kingdom enjoyed years of peace after construction of an enormous wall protecting them from neighboring invasions. But, one day this comes to an end when the Demon Emperor Jaldabaoth arrives with an army of villainous demi-humans. Fearing invasion of their own lands, the neighboring territory of the Slane Theocracy is forced to beg their enemies at the Sorcerer Kingdom for help. Heeding the call, Momonga, now known as the Sorcerer King Ains Ooal Gown, rallies the Sorcerer Kingdom and its undead army to join the fight alongside the Sacred Kingdom and the Slane Theocracy in hopes to defeat the Demon Emperor.', 8040, '2024-09-20', 'Fantasy', 'JP', 'https://www.themoviedb.org/t/p/w1280/jEvytxNa5mfW7VAUmDWsZtIdATc.jpg', 'https://youtube.com/embed/K9hf4dmYJwc', 3.9),
('red-one', 'Red One', 'After Santa Claus (codename: Red One) is kidnapped, the North Pole\'s Head of Security must team up with the world\'s most infamous bounty hunter in a globe-trotting, action-packed mission to save Christmas.', 7440, '2024-11-15', 'Fantasy', 'VN', 'https://www.themoviedb.org/t/p/w1280/cdqLnri3NEGcmfnqwk2TSIYtddg.jpg', 'https://youtube.com/embed/7l3hfD74X-4', 3.3),
('smile-2', 'Smile 2', 'About to embark on a new world tour, global pop sensation Skye Riley begins experiencing increasingly terrifying and inexplicable events. Overwhelmed by the escalating horrors and the pressures of fame, Skye is forced to face her dark past to regain control of her life before it spirals out of control.', 7620, '2024-10-18', 'Horror', 'US', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/ht8Uv9QPv9y7K0RvUyJIaXOZTfd.jpg', 'https://youtube.com/embed/FU_bAopCcSE', 3.5),
('terrifier-3', 'Terrifier 3', 'Five years after surviving Art the Clown\'s Halloween massacre, Sienna and Jonathan are still struggling to rebuild their shattered lives. As the holiday season approaches, they try to embrace the Christmas spirit and leave the horrors of the past behind. But just when they think they\'re safe, Art returns, determined to turn their holiday cheer into a new nightmare. The festive season quickly unravels as Art unleashes his twisted brand of terror, proving that no holiday is safe.', 7500, '2024-10-11', 'Horror', 'US', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/l1175hgL5DoXnqeZQCcU3eZIdhX.jpg', 'https://youtube.com/embed/0EDDtgWnSeY', 3.5),
('the-substance', 'The Substance', 'A fading celebrity decides to use a black market drug, a cell-replicating substance that temporarily creates a younger, better version of herself.', 8460, '2024-11-10', 'Drama', 'VN', 'https://www.themoviedb.org/t/p/w1280/lqoMzCcZYEFK729d6qzt349fB4o.jpg', 'https://youtube.com/embed/lR5nlovVgvQ', 3.7),
('the-wild-robot', 'The Wild Robot', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', 6120, '2024-10-11', 'Animation', 'VN', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/wTnV3PCVW5O92JMrFvvrRcV39RU.jpg', 'https://youtube.com/embed/VUCNBAmse04', 4.3),
('transformers-one', 'Transformers One', 'The untold origin story of Optimus Prime and Megatron, better known as sworn enemies, but once were friends bonded like brothers who changed the fate of Cybertron forever.', 6240, '2024-09-20', 'Family', 'VN', 'https://www.themoviedb.org/t/p/w1280/qbkAqmmEIZfrCO8ZQAuIuVMlWoV.jpg', 'https://youtube.com/embed/jaVcDaozGgc', 4.1),
('venom-the-last-dance', 'Venom: The Last Dance', 'Eddie and Venom are on the run. Hunted by both of their worlds and with the net closing in, the duo are forced into a devastating decision that will bring the curtains down on Venom and Eddie\'s last dance.', 6540, '2024-10-25', 'Science Fiction', 'VN', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/aosm8NMQ3UyoBVpSxyimorCQykC.jpg', 'https://youtube.com/embed/FKBN1qAzW3s', 3.3),
('wicked', 'Wicked', 'Elphaba, a young woman misunderstood because of her green skin, and Glinda, a popular aristocrat gilded by privilege, become unlikely friends in the fantastical Land of Oz. As the two women struggle with their opposing personalities, their friendship is tested as both begin to fulfill their destinies as Glinda the Good and the Wicked Witch of the West.', 9660, '2024-11-29', 'Drama', 'VN', 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/c5Tqxeo1UpBvnAc3csUm7j3hlQl.jpg', 'https://youtube.com/embed/pqi45Qhq3CI', 4.0);
